import React from 'react';

const Condition = (props) => {
    return (
        <div>
            <option className="option" onClick={props.handleConditionChange} name="condition" value="excellent"> Excellent </option>
            <option className="option" onClick={props.handleConditionChange}  value="very good"> Very Good </option>
            <option className="option" onClick={props.handleConditionChange}  value="good"> Good </option>
            <option className="option" onClick={props.handleConditionChange}  value="fair"> Fair </option>
        </div>
    )
} 

export default Condition;
